const PlanetList = () => {
  return [
    { Name: Mercury, Population: 0, Img: "" },
    { Name: Venus, Population: 0, Img: "" },
    { Name: Earth, Population: 100000, Img: "" },
    { Name: Mars, Population: 0, Img: "" },
    { Name: Jupiter, Population: 0, Img: "" },
    { Name: Saturn, Population: 0, Img: "" },
    { Name: Neptune, Population: 0, Img: "" },
    { Name: Uranus, Population: 0, Img: "" },
  ];
};
